import React from 'react';
import './Home.css';

function Home() {
  return (
    <div className="home">
      {/* Image Background */}
      <img src="/try.jp" alt="rag background" className="background-image" />

      {/* Text over Image */}
      <h1>Welcome</h1>
    </div>
  );
}

export default Home;
